ent.getElementById(\\\"profitMargin\\\").value) / 100;\\n            \\n            // Base Expenses\\n            let baseExpenses = 0;\\n            let expenseInputs = document.getElementsByClassName(\\\"expense-amount\\\");\\n            for (let i = 0; i \u003c expenseInputs.length; i++) {\\n                baseExpenses += parseFloat(expenseInputs[i].value) || 0;\\n            }\\n            \\n            // Texas Payroll Tax Calculation\\n            let socialSecurityTaxRate = 6.2 / 100;\\n            let medicareTaxRate = 1.45 / 100;\\n            let unemploymentTaxRate = 0.91 / 100;\\n            \\n            let totalLaborWages = workers * hourlyWage * shiftDuration * shiftsPerMonth;\\n            let socialSecurityTax = totalLaborWages * socialSecurityTaxRate;\\n            let medicareTax = totalLaborWages * medicareTaxRate;\\n            let unemploymentTax = totalLaborWages * unemploymentTaxRate;\\n            let totalPayrollTaxes = socialSecurityTax + medicareTax + unemploymentTax;\\n            \\n            let totalLaborCost = totalLaborWages + totalPayrollTaxes;\\n            let totalMonthlyCost = totalLaborCost + baseExpenses;\\n            let costPerShift = totalMonthlyCost / shiftsPerMonth;\\n            let costPerUnitPerMonth = totalMonthlyCost / units;\\n            let revenuePerUnit = costPerUnitPerMonth * (1 + profitMargin);\\n            let revenuePerMonth = totalMonthlyCost * (1 + profitMargin);\\n            let revenuePerShift = costPerShift * (1 + profitMargin);\\n            \\n            document.getElementById(\\\"totalMonthlyCost\\\").innerText = \\\"$\\\" + totalMonthlyCost.toFixed(2);\\n            document.getElementById(\\\"costPerShift\\\").innerText = \\\"$\\\" + costPerShift.toFixed(2);\\n            document.getElementById(\\\"costPerUnitPerMonth\\\").innerText = \\\"$\\\" + costPerUnitPerMonth.toFixed(2);\\n            document.getElementById(\\\"revenuePerUnit\\\").innerText = \\\"$\\\" + revenuePerUnit.toFix
